import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';

const ServicesSection1 = () => {
  const services = [
    {
      title: 'Home Cleaning',
      img: 'https://images.unsplash.com/photo-1581579186985-4a741702a5af',
    },
    {
      title: 'Furniture Assembly',
      img: 'https://images.unsplash.com/photo-1597093288432-c3f83aa7057f',
    },
    {
      title: 'TV Mounting',
      img: 'https://images.unsplash.com/photo-1616627562160-5d8d12d56de6',
    },
    {
      title: 'Wall Hanging',
      img: 'https://images.unsplash.com/photo-1597093871237-948563b9e198',
    },
  ];

  return (
    <section className="py-5 bg-white">
      <Container>
        <div className="d-flex justify-content-between align-items-center mb-3">
          <h3 className="fw-bold mb-0">Cleaning & Handyman Tasks</h3>
          <a href="#" className="text-info text-decoration-none fw-semibold">
            See All &gt;
          </a>
        </div>
        <p className="text-muted mb-4">
          Instantly book highly rated pros for cleaning and handyman tasks at an upfront price.
        </p>
        <Row>
          {services.map((service, index) => (
            <Col key={index} xs={6} md={3} className="mb-4">
              <Card className="h-100 border-0 shadow-sm">
                <Card.Img
                  variant="top"
                  src={`${service.img}?auto=format&fit=crop&w=600&q=80`}
                  alt={service.title}
                  style={{ height: '180px', objectFit: 'cover' }}
                />
                <Card.Body className="text-center border-top">
                  <Card.Text className="fw-semibold mb-0">{service.title} &gt;</Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>
    </section>
  );
};

export default ServicesSection1;
